import React, { Component } from 'react';
import Nash from './Nash';
class Project extends Component {
	constructor() {
		super();

		this.state = {
			sefo: [ { id: 1, img: 'img/1.jpg' }, { id: 3, img: 'img/1.jpg' }, { id: 2, img: 'img/3.jpg' } ]
		};
	}

	mappig(x) {
		const em = x.map((s) => <Nash key={s.id} img={s.img} />);

		return em;
	}

	render() {
		return <div className="row">{this.mappig(this.state.sefo)}</div>;
	}
}
export default Project;
